import random

def dice_roll():
    return random.randint(1,)

def winner():
    diceNo1 = int(dice_roll())
    diceNo2 = int(dice_roll())

    print(f'dice no 1 rolled a {diceNo1}')
    print(f'dice no 2 rolled a {diceNo2}')
    if diceNo1 == diceNo2:
        result = ('it\'s a draw')
    elif diceNo1 > diceNo2:
        result = (f'dice 1 wins by {diceNo1-diceNo2}')
    else:
        result = (f'dice 2 wins by {diceNo2-diceNo1}')
    return(result)

